?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"> 	<span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта, известнейшая по всему миру компания, была основана в далеком 1860 году. Как и большинство швейцарских компаний, изначально это была всего лишь небольшая мастерская, где Эдуард Хойер (основатель компании и талантливый часовщик) принимал заказы на починку наручных часов.&nbsp; Это семейный бизнес был тщательно налажен. После нескольких десятилетий, это была полноценная компания по производству высококачественных часов. Но, в 1958 году, основатель компании решил передать свое дело сыну. Изначально, сын не очень был заинтересован в часовом деле, но потом вошел во вкус, и уже полностью управлял этой огромной компанией. Но вскоре, кризис пошатнул деятельность компании, и владелец компании не смог больше ею управлять. Производство часов было возобновлено лишь в 1985 году, при помощи одной исследовательской организации. Нынешние владельца компании даже пригласили бывшего директора Джека Хойера, который был назначен на пост председателя компании. На сегодняшний день эта компания является спонсором многих спортивных мероприятий. Популярность во всем мире компании обеспечивает огромный ассортимент высококачественных часов с оригинальным дизайном. Часы&nbsp;<span lang="EN-US">TAG</span><span lang="EN-US">&nbsp;</span><span lang="EN-US">Heuer</span><span lang="EN-US">&nbsp;</span>отлично подойдут деловым людям, предпочитающим строгие и оригинальные аксессуары.</span></span></p>
 
